import React, { useState, useEffect } from "react";
import { useNavigate, useParams } from "react-router-dom";
import { qnBuffer, choiceBuffer } from "./Home";
import {StyledButton, StyledForm, StyledFormWrapper, StyledHeader} from "./Style.jsx"

function ResponseDisplay() {

  const navigate = useNavigate()
  const [list, setList] = useState([])
  const [resp, setResp] = useState({
    name: " ",
    colour: {
      Blue: false,
      Red: false,
      Green: false,
      Yellow: false,
      Purple: false,
      Pink: false
    },
    prog_lang: {
      Python: false,
      Java: false,
      Ruby: false,
      JavaScript: false,
      Golang: false
    },
    languages: {
      English: false,
      Chinese: false,
      Malay: false,
      Tamil: false,
      Hindi: false
    },
    would_pay: {
      Yes: false,
      No: false
    }
  })

  // fetch data
  useEffect(() => {
    fetch("http://localhost:3500/questions/responses")
      .then(res => res.json())
      .then(resJson => setResp(resJson.data))
  }, [])

  return (
    <div>
      <button onClick={() => navigate(-1)}>Back</button>
      <StyledForm>
      </StyledForm>
    </div>
  )
}

export default ResponseDisplay
